    return (
        <>
            <Form >
                <Form.Group className={`d-flex justify-content-center mt-5 gap-4`}>
                    <Form.Label>
                    <Form.Control size={'lg'}  type="text" placeholder={'Enter Your City !'}></Form.Control>
                    </Form.Label>
                    <Form.Label>
                    <Button size={'lg'}  variant={'primary'}>Search</Button>
                    </Form.Label>
                </Form.Group>
            </Form>
        </>
    );
};
